import { getByPlaceholderText } from "@testing-library/react";
import axios from "axios";
const API_BASE_URL = "https://the-rosary-api.vercel.app";

class Rosary {
  /**MM/DD/YY */
  static async getByDay(day) {
    try {
      const res = await axios.get(`${API_BASE_URL}/v1/${day.toLowerCase()}`, {
        "access-control-allow-origin": "*",
      });
      console.log(res);
      return res;
    } catch (err) {
      throw new Error(err);
    }
  }
  static async getByDate(date) {
    try {
      const result = await axios.get(`${API_BASE_URL}/v1/date/${date}`, {
        "access-control-allow-origin": "*",
      });

      // const day = await this.getByDay("tuesday");
      // console.log(day);

      console.log(result);
      return result;
    } catch (err) {
      throw new Error(err);
    }

    // const res = await this.getByDay(result.data.rosary_day);
    // console.log(res);
    // return res;
  }
}
export default Rosary;
